import './add-item.css';

export default class AddItem extends Component {



  render() {
    return (
<form className="form-inline add-item">
  <div className="form-group ">
    <input type="password" className="form-control" placeholder="Add a new Item" />
  </div>
  <button className="btn btn-success" type="button"
          onClick={() => this.props.onAdded('lalala')}>Add
  </button>
</form>
    );
  }
};
